import React, { useEffect, useState } from 'react';
import axios from 'axios';
import CustomNavbar from "./Header";
import { Form, Label, Input, FormGroup, Button } from "reactstrap";

function Sales() {
  const [salesdata, setsalesdata] = useState([]);

  useEffect(() => {
    axios
      .get('http://127.0.0.1:8000/project/sales/')
      .then((res) => setsalesdata(res.data));
  }, []);

  return (
    <>
      <CustomNavbar />
      <Form style={{ width: "800px", marginTop: "100px" }}> {/* Example style */}
        <br />
        <FormGroup>
          <Label for="csv_file">Upload Your Sales CSV</Label>
          <Input id="csv_file" name="csv_file" type="file" />
        </FormGroup>
        <Button className="btn btn-success" type="submit">Submit</Button>
        <br />
        <h1>Get Sales Info</h1>
      </Form>
    </>
  );
}

export default Sales;
